import React from 'react';

function InfoBlock(props) {
    return (
        <section>
            <h3 className="info-heading">{props.header}</h3>
            <p className="info-message">{props.info}</p>
            <a href={props.link}>LEARN MORE</a>
        </section>
    )
}

export default InfoBlock;
